function start_game() 
 scene=sc_explore
	if DEBUG then
	 enter_room(14,1)
	else
  enter_room(1,1)
	end
end

function enter_room(rn,en)
 roomn=rn
 room=rooms[rn]
	ent=room.ent[en]
	player.x=ent.px-room.mx
	player.y=ent.py-room.my
end

function sc_explore()
	cls(0)
	map(room.mx,room.my)
	if DEBUG then print("ROOM #"..roomn) end

 if room.mobs then
 for mn,mi in pairs(room.mobs) do
	 if mi.dead then
		 if mi.mitm then
				local i=items[mi.mitm]
				local iw=i.w or 1
				local ih=i.h or 1
			 spr(i.spr, mi.px, mi.py, 11, 1, 0, 0, iw, ih)
   end
		else
	 if not mi.t then mi.t = 0 end
		mi.px=(mi.mx-room.mx)*8
		mi.py=(mi.my-room.my)*8
	 spr(mi.ms,mi.px,mi.py, 11)

  if mi.t == 0 then
		 mi.t = 30
			
			local mdy=-1
			if math.random(2) % 2 == 0 then
			 mdy=1
		 end
			
			local mny = mi.my + mdy
			if not fget(mget(mi.mx, mny), 0) then
				mi.my = mny
			end		
		else
		 mi.t = mi.t - 1
		end	
		
		 if mi.t == 0 then
		 mi.t = 30
			
			local mdx=-1
			if math.random(2) % 2 == 0 then
			 mdx=1
		 end
			
			local mnx = mi.mx + mdx
			if not fget(mget(mnx, mi.my), 0) then
				mi.mx = mnx
			end		
		else
		 mi.t = mi.t - 1
		end
		end
	end
 end

	for sn,si in pairs(shots) do
	 local fi=0 ri=	0
		if si.dx > 0 then
			fi=1
		elseif si.dy < 0 then
			ri=1
		elseif si.dy > 0 then
		 ri=3
		end	
		spr(320, si.x, si.y, 11, 1, fi, ri)
		local die = false
		si.x=si.x+si.dx
		si.y=si.y+si.dy
		if si.x < 0 or 
				 si.y < 0 or
					si.x > 240 or
					si.y > 136 then
			die = true
		end
		if fget(mget(room.mx+(si.x//8), room.my+(si.y//8)),0) then
			die = true
		end
		if room.mobs then
	 for mn,mi in pairs(room.mobs) do
			if si.x == mi.px and si.y == mi.py then
				die = true
				mi.dead = true
			end
		end
		end
		if die then
			table.remove(shots, sn)
		end
	end

	p=player
	local cspr=p.spr
	if p.sst > 20 then
		cspr=258
	elseif p.sst > 10 then
		cspr=259
	end
	spr(cspr,p.x*8,p.y*8,11)
	
	function move(dx,dy)
	 p.sdx=dx
		p.sdy=dy
	 nx=p.x+dx
		ny=p.y+dy
		mnx=room.mx+nx
		mny=room.my+ny
		if room.ext then
		for ei,e in ipairs(room.ext) do
		 if mnx==e.x and mny==e.y then
			 enter_room(e.r,e.e)
				return
			end
		end
		end
		if not fget(mget(					mnx,mny),0) then
		 p.x=nx
			p.y=ny
			p.spr=p.sprb+(((p.spr-p.sprb)+1)%2)
			return
		end
		--- XXX add a bump sound
	end

	if p.sst > 0 then
		p.sst = p.sst - 1
		if p.sst == 0 then
			table.insert(shots, {x=p.x*8, y=p.y*8, dx=p.sdx, dy=p.sdy})
		end
	else
	 if btnp(5,1,10) then p.sst = 30 end
		if btnp(0,1,10) then move(0,-1) end
	 if btnp(1,1,10) then move(0,1) end
	 if btnp(2,1,10) then move(-1,0) end
	 if btnp(3,1,10) then move(1,0) end	
	end
end

